import { Link } from "react-router-dom";

//Tasklist takes tasks and 
const TaskList = ({ tasks }) => {
    return (
        <div>
            {tasks.map((task) => (
                <div key={task.id}>
                    <Link to={`/tasks/${task.id}`}>
                        <h2>{task.name}</h2>
                        <p>{task.desc}</p>
                    </Link>
                </div>
            ))}
        </div>
    );
};

export default TaskList;
